func NewReceiptServiceJSONClient(addr string, client HTTPClient) ReceiptService {
	prefix := urlBase(addr) + ReceiptServicePathPrefix
	urls := [7]string{
		prefix + "CreateReceipt",
		prefix + "UpdateReceipt",
		prefix + "GetReceipt",
		prefix + "GetReceipts",
		prefix + "GetReceiptsByLedgerType",
		prefix + "ConfirmReceipt",
		prefix + "CancelReceipt",
	}
	if httpClient, ok := client.(*http.Client); ok {
		return &receiptServiceJSONClient{
			client: withoutRedirects(httpClient),
			urls:   urls,
		}
	}
	return &receiptServiceJSONClient{
		client: client,
		urls:   urls,
	}
}

func (c *receiptServiceJSONClient) CreateReceipt(ctx context.Context, in *CreateReceiptRequest) (*Receipt, error) {
	ctx = ctxsetters.WithPackageName(ctx, "shop")
	ctx = ctxsetters.WithServiceName(ctx, "Receipt")
	ctx = ctxsetters.WithMethodName(ctx, "CreateReceipt")
	out := new(Receipt)
	err := doJSONRequest(ctx, c.client, c.urls[0], in, out)
	if err != nil {
		return nil, err
	}
	return out, nil
}

