// VendorService Server Handler
// ============================

type vendorServiceServer struct {
	VendorService
	hooks *twirp.ServerHooks
}

func NewVendorServiceServer(svc VendorService, hooks *twirp.ServerHooks) TwirpServer {
	return &vendorServiceServer{
		VendorService: svc,
		hooks:         hooks,
	}
}

// writeError writes an HTTP response with a valid Twirp error format, and triggers hooks.
// If err is not a twirp.Error, it will get wrapped with twirp.InternalErrorWith(err)
func (s *vendorServiceServer) writeError(ctx context.Context, resp http.ResponseWriter, err error) {
	writeError(ctx, resp, err, s.hooks)
}

// VendorServicePathPrefix is used for all URL paths on a twirp VendorService server.
// Requests are always: POST VendorServicePathPrefix/method
// It can be used in an HTTP mux to route twirp requests along with non-twirp requests on other routes.
const VendorServicePathPrefix = "/api/shop.Vendor/"

func (s *vendorServiceServer) ServeHTTP(resp http.ResponseWriter, req *http.Request) {
	ctx := req.Context()
	ctx = ctxsetters.WithPackageName(ctx, "shop")
	ctx = ctxsetters.WithServiceName(ctx, "Vendor")
	ctx = ctxsetters.WithResponseWriter(ctx, resp)

	var err error
	ctx, err = callRequestReceived(ctx, s.hooks)
	if err != nil {
		s.writeError(ctx, resp, err)
		return
	}

	if req.Method != "POST" {
		msg := fmt.Sprintf("unsupported method %q (only POST is allowed)", req.Method)
		err = badRouteError(msg, req.Method, req.URL.Path)
		s.writeError(ctx, resp, err)
		return
	}

	switch req.URL.Path {
	case "/api/shop.Vendor/GetVendor":
		s.serveGetVendor(ctx, resp, req)
		return
	case "/api/shop.Vendor/GetVendors":
		s.serveGetVendors(ctx, resp, req)
		return
	case "/api/shop.Vendor/GetVendorsByIDs":
		s.serveGetVendorsByIDs(ctx, resp, req)
		return
	case "/api/shop.Vendor/CreateVendor":
		s.serveCreateVendor(ctx, resp, req)
		return
	case "/api/shop.Vendor/UpdateVendor":
		s.serveUpdateVendor(ctx, resp, req)
		return
	case "/api/shop.Vendor/DeleteVendor":
		s.serveDeleteVendor(ctx, resp, req)
		return
	default:
		msg := fmt.Sprintf("no handler for path %q", req.URL.Path)
		err = badRouteError(msg, req.Method, req.URL.Path)
		s.writeError(ctx, resp, err)
		return
	}
}

