func (s *ledgerServiceServer) ServeHTTP(resp http.ResponseWriter, req *http.Request) {
	ctx := req.Context()
	ctx = ctxsetters.WithPackageName(ctx, "shop")
	ctx = ctxsetters.WithServiceName(ctx, "Ledger")
	ctx = ctxsetters.WithResponseWriter(ctx, resp)

	var err error
	ctx, err = callRequestReceived(ctx, s.hooks)
	if err != nil {
		s.writeError(ctx, resp, err)
		return
	}

	if req.Method != "POST" {
		msg := fmt.Sprintf("unsupported method %q (only POST is allowed)", req.Method)
		err = badRouteError(msg, req.Method, req.URL.Path)
		s.writeError(ctx, resp, err)
		return
	}

	switch req.URL.Path {
	case "/api/shop.Ledger/GetLedger":
		s.serveGetLedger(ctx, resp, req)
		return
	case "/api/shop.Ledger/GetLedgers":
		s.serveGetLedgers(ctx, resp, req)
		return
	case "/api/shop.Ledger/CreateLedger":
		s.serveCreateLedger(ctx, resp, req)
		return
	case "/api/shop.Ledger/UpdateLedger":
		s.serveUpdateLedger(ctx, resp, req)
		return
	case "/api/shop.Ledger/DeleteLedger":
		s.serveDeleteLedger(ctx, resp, req)
		return
	default:
		msg := fmt.Sprintf("no handler for path %q", req.URL.Path)
		err = badRouteError(msg, req.Method, req.URL.Path)
		s.writeError(ctx, resp, err)
		return
	}
}

